(166285, 'D3B49193-5DF8-401C-92F7-35A7F00E83CF', 'This kinda reminds me of an old yiddish tale. A man complained to his rabbi about the fact that his house was too small and that there was just no room for his large family. What to do? The rabbi suggested that he bring his goats into the house. But Rabbi, my house is already so full. Why does this make any sense in the world? Just try it says the Rabbi. Then a few months go by and the man comes back to the Rabbi and says now my home is even more crowded and cluttered. What now? The rabbi says ‚Äúmove in the sheep too‚Äù What?!? Are you out of your mind? How is this solving anything says the man. But he does it, as all good citizens that follow rabbis do. ', 'Nitzan', 'David', '2015-12-07T14:24:49'),
